import React from "react";

const WinnersList: React.FC = () => {
    const dummyWinners = [
        { address: "0x1234...abcd", reward: "1.5 ETH", round: 1 },
        { address: "0x5678...efgh", reward: "0.8 ETH", round: 2 },
        { address: "0x9abc...ijkl", reward: "2.3 ETH", round: 3 },
    ];

    return (
        <div className="winners-list">
            <h2>Past Winners</h2>
            <ul>
                {dummyWinners.map((winner, index) => (
                    <li key={index}>
                        <strong>Round {winner.round}:</strong> {winner.address} won {winner.reward}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default WinnersList;
